	/* Function prototypes */
	public static int lookup_table(gen_table tbl, int find_token)
	{
		while (tbl.key != null)
		{
		if (GlobalMembersUtil.almost_equals(find_token, tbl.key) != 0)
			return tbl.value;
		tbl++;
		}
		return tbl.value; // *_INVALID
	}
	public static parsefuncp_t lookup_ftable(gen_ftable ftbl, int find_token)
	{
		while (ftbl.key != null)
		{
		if (GlobalMembersUtil.almost_equals(find_token, ftbl.key) != 0)
			return ftbl.value;
		ftbl++;
		}
		return ftbl.value;
	}

/* Returns value of the first table entry for which the search string
 * is a leading substring, or -1 if there is no match.
 */
	public static int lookup_table_entry(gen_table tbl, String search_str)
	{
		while (tbl.key != null)
		{
		if (!strncmp(search_str, tbl.key, search_str.length()))
			return tbl.value;
		tbl++;
		}
		return -1;
	}

/* Returns the index of the table entry whose key matches the search string.
 * If there is no exact match return the first table entry that is a leading
 * substring of the search string.  Returns -1 if there is no match.
 */
	public static int lookup_table_nth(gen_table[] tbl, String search_str)
	{
		int k = -1;
		int best_so_far = -1;
		while (tbl[++k].key != null)
		{
		/* Exact match always wins */
		if (!strcmp(search_str, tbl[k].key))
			return k;
		if (!strncmp(search_str, tbl[k].key, String.valueOf(tbl[k].key).length()))
			if (best_so_far < 0)
				best_so_far = k;
		}
		return best_so_far;
	}

/* Returns index of the table tbl whose key matches the beginning of the
 * search string search_str. The table_len is necessary because the table
 * is searched in the reversed order. The routine is used in parsing commands
 * '(un)set log x2zcb', for instance.
 * It returns index into the table or -1 if there is no match.
 */
	public static int lookup_table_nth_reverse(gen_table[] tbl, int table_len, String search_str)
	{
		while (--table_len >= 0)
		{
		if (tbl[table_len].key != null && !strncmp(search_str, tbl[table_len].key, String.valueOf(tbl[table_len].key).length()))
			return table_len;
		}
		return -1; // not found
	}

/* Returns the key associated with this indexed value
 * or NULL if the key/value pair is not found.
 */
	public static String reverse_table_lookup(gen_table[] tbl, int entry)
	{
		int k = -1;
		while (tbl[++k].key != null)
		if (tbl[k].value == entry)
			return (tbl[k].key);
		return DefineConstants.NULL;
	}




